import styled from 'styled-components';

const Styled = styled.section``;

const MovieProfile = ({ movie, typeFor }) => {
  console.log('profile', movie);
  return <Styled className='profile'>Moviess fsdafa asfasfa</Styled>;
};

MovieProfile.getInitialProps = async ctx => {
  console.log(ctx);

  try {
    const { results: movie } = await movieDB(`movie/${ctx.query.id}`);

    return {
      movie
    };
  } catch (error) {
    console.log(error);
  }
};

export default MovieProfile;
